import React, { Component } from 'react'
import { storeProducts } from "./data"

export default class CustomObj extends Component {
    constructor(props) {
        super(props)
        this.state = {
            store: storeProducts.data,
            tempObjData: ''
        }
    }

    render() {
        let store = this.state.store;
        var tempObj = {};

        Object.keys(store).forEach(function (k) {
            var val = store[k];
            var customer = val['customer_name'];
            var month = val['month'];
            var itemName = val['item_name']
            var salesPerson = val['salesperson_name']

            if (!tempObj[customer])
                tempObj[customer] = {};

            if (!tempObj[customer][month])
                tempObj[customer][month] = {}

            if (!tempObj[customer][month][itemName])
                tempObj[customer][month][itemName] = {}

            if (!tempObj[customer][month][itemName][salesPerson])
                tempObj[customer][month][itemName][salesPerson] = {}

            tempObj[customer][month][itemName][salesPerson]['value'] = val['taxpaidamount'];
            tempObj[customer][month][itemName][salesPerson]['qty'] = val['qty'];

        });

        // console.log("result :", tempObj);
        // console.log(JSON.stringify(tempObj))
        this.setState({
            tempObjData:JSON.stringify(tempObj)
        })
        // var tempObjData = JSON.stringify(tempObj)
        // console.log("dsfdsf",tempObjData)

        // let data = tempObjData.map(item=>{
        //     return (
        //         <tr>
        //             <td>
        //                 {item}
        //             </td>
        //         </tr>
        //     )
        // })
        let dataa = this.state.tempObjData.map(s => (<li>{s}</li>))

        return(
          <>
                    <ul>
                        {dataa}
                    </ul>
          </>
      )
    }
}
